Under the roadmap view, you used to be able to click the (blue up and to

the right) arrow under a development program (left side of roadmap) or POR

and open it up for edit.  That doesn't seem to work reliably.  Example is

the ACERM roadmap, the E3C button doesn't open E3C but the arrow buttons for

ACERM development and POR's do work.  Weird but only mildly annoying. 

 

Brad Neal says - Unable to reproduce... I had to turn of pop up blocker and it worked fine.

