This is an old one but maybe I didn't document it before.  Under

development programs, if you want to change an image (browse to folder, pick

image), it sometimes just doesn't do it.  I don't know the secret, but if I

try a bunch of times and sometimes change the image format it seems to work.

Maybe there's no causal relationship at all and it just sometimes takes many

attempts.  Fairly annoying.

 

Brad says... I am unable to reproduce this.
